import {BrowserRouter} from "react-router-dom";
import Homepage from "./pages/Homepage";
import Inspo from './pages/Inspo';

function App(){ 
   return ( 
      <div className="App"> 
      <BrowserRouter> 
          <Homepage /> 
          <Inspo/>
      </BrowserRouter> 

    </div> 
)} 
export default App;
